import React from "react";
import { useNavigate } from "react-router-dom";
import "./DashboardFuncionario.css";

function DashboardFuncionario() {
  const navigate = useNavigate();

  const handleIngresarFormulario = () => {
    navigate("/formulario"); // Aquí redirige al formulario
  };

  return (
    <div className="dashboard-container">
      <h2>Dashboard Funcionario</h2>
      
      <button id="add-new" onClick={handleIngresarFormulario}>
        Ingresar Formulario
      </button>

      {/* Aquí iría tu tabla de funcionarios */}
      <table>
        <thead>
          <tr>
            <th>Nombres</th>
            <th>Apellidos</th>
            <th>Cargo</th>
            <th>Turno</th>
            <th>Asistencia</th>
            <th>Acciones</th>
          </tr>
        </thead>
        <tbody>
          {/* Renderiza los funcionarios aquí */}
        </tbody>
      </table>
    </div>
  );
}

export default DashboardFuncionario;
